ts.Container_description = "<div class=\"tsd-comment tsd-typography\" id=\"description\">\n\t\t\t\t\t<div class=\"lead\">\n\t\t\t\t\t\t<h5 id=\"-container-class-description-\"><strong>Container - Class Description:</strong></h5>\n\t\t\t\t\t</div>\n\t\t\t\t\t<p>a (instance of Container) is simply a column OR (Never And) a row of Items.</p>\n\t\t\t\t\t<p>A Container is an essential part of how liefs-layout-manager works.  That being said,\n\t\t\t\t\tit is mostly invisible - which can be confusing.</p>\n\t\t\t\t\t<pre><code class=\"lang-javascript\"><span class=\"hljs-keyword\">var</span> l=I(<span class=\"hljs-string\">\"LeftSide\"</span>,<span class=\"hljs-string\">\"200px\"</span>); <span class=\"hljs-comment\">// This defines an (instance of Item) - No Containers</span>\n</code></pre>\n\t\t\t\t\t<p>The above only defines a Item.</p>\n\t\t\t\t\t<pre><code class=\"lang-javascript\"><span class=\"hljs-keyword\">var</span> B=h(<span class=\"hljs-string\">\"Both\"</span>, I(<span class=\"hljs-string\">\"LeftSide\"</span>,<span class=\"hljs-string\">\"200px\"</span>), I(<span class=\"hljs-string\">\"RightSide\"</span>,<span class=\"hljs-string\">\"100%\"</span>)); <span class=\"hljs-comment\">// This line creates 3 Items, and 1 Container.</span>\n</code></pre>\n\t\t\t\t\t<p>The above does the following:</p>\n\t\t\t\t\t<ul>\n\t\t\t\t\t\t<li>Defines (instace of Item) \"LeftSide\"</li>\n\t\t\t\t\t\t<li>Defines (instace of Item) \"RightSide\"</li>\n\t\t\t\t\t\t<li>Defines (instace of Container) \"Both\" - with array of [LeftSide, RightSide] - horizontal direction indicator</li>\n\t\t\t\t\t\t<li>Defines (instance of Item) \"Both\" - with (instance of Item).container = (the above line)</li>\n\t\t\t\t\t</ul>\n\t\t\t\t\t<p>Understanding the above, there is no need to access the Container Directly.\n\t\t\t\t\t\twith the intension of making liefs-layout-manager easier to use, you ALWAYS refer to the Item.\n\t\t\t\t\t\t...so even when we want data from a Container, we use the Item, and liefs-layout-manager finds the\n\t\t\t\t\tmatching container in the background.</p>\n\t\t\t\t\t<p>It is helpful, if not key, Understanding this.</p>\n\t\t\t\t</div>";
