ts.Handler_description = "<div class=\"tsd-comment tsd-typography\" id=\"description\">\n\t\t\t\t\t<div class=\"lead\">\n\t\t\t\t\t\t<h5 id=\"-handler-class-description-static-instance-\"><strong>Handler - Class Description: STATIC/INSTANCE</strong></h5>\n\t\t\t\t\t\t<p>Please take note that Handler (caps) Refers to the Static Object Class Handler\n\t\t\t\t\t\t(instance of Handler) refers to an Instance of Handler Class</p>\n\t\t\t\t\t</div>\n\t\t\t\t\t<p>In essence, liefs-layout-manager.Handler manages the layouts, and handles resize event correctly.</p>\n\t\t\t\t\t<p>Once I() is called even once, (after a small while) A master Handler Instance will\n\t\t\t\t\tbe created. (If you didn't make one)</p>\n\t\t\t\t\t<p>On resizeEvent, Handler loops though all (instance of Handler)s,\n\t\t\t\t\tFor each (instance of Handler):</p>\n\t\t\t\t\t<ul>\n\t\t\t\t\t\t<li>Loops through (Handler Instance).layouts (Array<layout>)\n\t\t\t\t\t\t\t\t...checking (Handler Instance).layouts[index].conditionalFunction to see if\n\t\t\t\t\t\t\t\t(Handler Instance).layouts[index].container should be the one used for (Handler Instance)\n\t\t\t\t\t\t... which means it find the layout you wanted to use for this screen resize.</layout></li>\n\t\t\t\t\t\t<li>Then it calculates the (Item Instance).size (Coord) for each visible Item,</li>\n\t\t\t\t\t\t<li>Then sets all visible items to visible, and Hidden to [Hidden AND (left, top, width and height set to 1px)]</li>\n\t\t\t\t\t\t<li>Then waits for next resizeEvent.</li>\n\t\t\t\t\t</ul>\n\t\t\t\t\t<p>I know the excitement is overwhelming you... lets read on for more details</p>\n\t\t\t\t</div>";
