ts.Functions_typeof = "<section id=\"typeof\" style=\"overflow-y: auto;\">\n\t\t\t\t\t<a name=\"typeof\" class=\"tsd-anchor\"></a>\n\t\t\t\t\t<h3>Type<wbr>Of</h3>\n\t\t\t\t\t<ul class=\"tsd-signatures tsd-kind-function tsd-parent-kind-external-module\">\n\t\t\t\t\t\t<li class=\"tsd-signature tsd-kind-icon\">Type<wbr>Of<span class=\"tsd-signature-symbol\">(</span>value<span class=\"tsd-signature-symbol\">: </span><span class=\"tsd-signature-type\">any</span>, match<span class=\"tsd-signature-symbol\">?: </span><span class=\"tsd-signature-type\">string</span><span class=\"tsd-signature-symbol\">)</span><span class=\"tsd-signature-symbol\">: </span><span class=\"tsd-signature-type\">string</span><span class=\"tsd-signature-symbol\"> | </span><span class=\"tsd-signature-type\">boolean</span></li>\n\t\t\t\t\t</ul>\n\t\t\t\t\t<ul class=\"tsd-descriptions\">\n\t\t\t\t\t\t<li class=\"tsd-description\">\n\t\t\t\t\t\t\t<aside class=\"tsd-sources\">\n\t\t\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t\t\t<li>Defined in liefs-layout-manager.ts:697</li>\n\t\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t\t</aside>\n\t\t\t\t\t\t\t<div class=\"tsd-comment tsd-typography\">\n\t\t\t\t\t\t\t\t<div class=\"lead\">\n\t\t\t\t\t\t\t\t\t<h5 id=\"-typeof-fuction-description-\"><strong>TypeOf - Fuction Description:</strong></h5>\n\t\t\t\t\t\t\t\t\t<p>TypeOf is an extended version of typeof. It as two purposes:</p>\n\t\t\t\t\t\t\t\t</div>\n\t\t\t\t\t\t\t\t<p>First,(One Argument) It Identifies type, and returns it.  If type is Array, or Object, then it\n\t\t\t\t\t\t\t\t\tassumes string key, and continues to TypeOf the value of Object[key:string].\n\t\t\t\t\t\t\t\t\"Classes\" are return by class name.</p>\n\t\t\t\t\t\t\t\t<p>Second, (Two Arguments) It compares Typeof First Argument, to pre-resolved type string of 2nd Argument</p>\n\t\t\t\t\t\t\t\t<h5 id=\"-example-usage-\"><strong>Example Usage:</strong></h5>\n\t\t\t\t\t\t\t\t<pre><code class=\"lang-javascript\">&gt; TypeOf(<span class=\"hljs-string\">\"abc\"</span>);                                 <span class=\"hljs-comment\">// OK So far just like typeof</span>\n<span class=\"hljs-string\">'string'</span>\n&gt; TypeOf([<span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">2</span>, <span class=\"hljs-number\">3</span>]);                             <span class=\"hljs-comment\">// if object, or array -&gt; recrusive TypeOf</span>\n<span class=\"hljs-string\">'array:number'</span>\n&gt; TypeOf(I(<span class=\"hljs-string\">\"Page4\"</span>,<span class=\"hljs-string\">\"250px\"</span>));                    <span class=\"hljs-comment\">// I() Returns a new instance of class Item</span>\n<span class=\"hljs-string\">'Item'</span>\n&gt; TypeOf(Item.items);                            <span class=\"hljs-comment\">// Items are stored by label, then instance, then class</span>\n<span class=\"hljs-string\">'object:array:Item'</span>\n&gt; TypeOf(Container.containers);                  <span class=\"hljs-comment\">// Containers never have more than one instance.</span>\n<span class=\"hljs-string\">'object:Container'</span>\n\n&gt; TypeOf(Item.items, <span class=\"hljs-string\">'object:array:Item'</span>);       <span class=\"hljs-comment\">// note: you can match full answer OR</span>\n<span class=\"hljs-literal\">true</span>\n&gt; TypeOf(Item.items, <span class=\"hljs-string\">'object:array'</span>);            <span class=\"hljs-comment\">// just a subset</span>\n<span class=\"hljs-literal\">true</span>\n</code></pre>\n\t\t\t\t\t\t\t</div>\n\t\t\t\t\t\t\t<h4 class=\"tsd-parameters-title\">Parameters</h4>\n\t\t\t\t\t\t\t<ul class=\"tsd-parameters\">\n\t\t\t\t\t\t\t\t<li>\n\t\t\t\t\t\t\t\t\t<h5>value: <span class=\"tsd-signature-type\">any</span></h5>\n\t\t\t\t\t\t\t\t\t<div class=\"tsd-comment tsd-typography\">\n\t\t\t\t\t\t\t\t\t\t<p>target of TypeOf (Required) - if no match argument, returns string</p>\n\t\t\t\t\t\t\t\t\t</div>\n\t\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t\t\t<li>\n\t\t\t\t\t\t\t\t\t<h5><span class=\"tsd-flag ts-flagDefault value\">Default value</span> match: <span class=\"tsd-signature-type\">string</span><span class=\"tsd-signature-symbol\"> =&nbsp;undefined</span></h5>\n\t\t\t\t\t\t\t\t\t<div class=\"tsd-comment tsd-typography\">\n\t\t\t\t\t\t\t\t\t\t<p>match string to compare agains result (Optional) return boolean</p>\n\t\t\t\t\t\t\t\t\t</div>\n\t\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t\t<h4 class=\"tsd-returns-title\">Returns <span class=\"tsd-signature-type\">string</span>\n\t\t\t\t\t\t\t\t<span class=\"tsd-signature-symbol\"> | </span>\n\t\t\t\t\t\t\t\t<span class=\"tsd-signature-type\">boolean</span>\n\t\t\t\t\t\t\t</h4>\n\t\t\t\t\t\t\t<p>no match - returns string - match - returns boolean</p>\n\t\t\t\t\t\t</li>\n\t\t\t\t\t</ul>\n\t\t\t\t</section>";
